class Solution1(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        rtype = 0
        strst = 0
        st = 0
        lens = 0
        HashDict = {}
        BreakSign = 1
        while BreakSign == 1:
            BreakSign = 0
            for j in range(st, len(s)):
                if s[j] in HashDict and HashDict[s[j]] >= strst:
                    BreakSign = 1
                    st = j + 1
                    if rtype < lens:
                        rtype = lens
                    lens = j - HashDict[s[j]]
                    strst = HashDict[s[j]] + 1
                    HashDict[s[j]] = j
                    break
                else:
                    HashDict[s[j]] = j
                    lens += 1
            if BreakSign == 0:
                if rtype < lens:
                    rtype = lens
                break
        return rtype
    
class Solution2(object):
    def lengthOfLongestSubstring(self, s):
        start = maxLength = 0
        usedChar = {}
        for index,char in enumerate(s):
            if char in usedChar and start <= usedChar[char]:
                start = usedChar[char] + 1
            else:
                maxLength = max(maxLength,index - start + 1)
            usedChar[char] = index
        print(index)
        return maxLength

